import { Injectable } from '@angular/core';
import {HttpClient} from '@angular/common/http';
import {Observable} from 'rxjs';
import { CookieService } from 'ngx-cookie-service';


@Injectable({
  providedIn: 'root'
})
export class SharedService {
readonly APIUrl="http://localhost:5000/api/";
readonly PhotoUrl = "http://localhost:5000/Photos/";

  constructor(private http:HttpClient, private cookieService:CookieService) { }

  CurrentUser:any;
  ActiveUser:boolean=false;

  UserByLogin:any;

  YoungMan1Source:string="data:image/png;base64,"+
        ""+
        ""+
        "";
  YoungMan2Source:string="data:image/png;base64,"+
        ""+
        ""+
        "";
  YoungMan3Source:string="data:image/png;base64,"+
        ""+
        ""+
        "";
  YoungWoman1Source:string="data:image/png;base64,"+
        ""+
        ""+
        "";
  YoungWoman2Source:string="data:image/png;base64,"+
        ""+
        ""+
        "";
  YoungWoman3Source:string="data:image/png;base64,"+
        ""+
        ""+
        "";

  delay(ms: number) {
    return new Promise( resolve => setTimeout(resolve, ms) );
  }

  getCurrentUser():any {
    var UserByLogin;
    var isPoolEnd=false;
    if (this.cookieService.check("CurrentUserLogin")) {
      var Login=this.cookieService.get("CurrentUserLogin");
      this.http.get<any>(this.APIUrl+"User/"+Login).subscribe(result => {
        UserByLogin =  {
          Name:result["Name"],
          Login:result["Login"],
          Password:result["Password"],
          Email:result["Email"],
          BirthDate:result["BirthDate"],
          AccountCreatingDate:result["AccountCreatingDate"],
          NumberOfPosts:result["NumberOfPosts"],
          Photo:result["Photo"]
        };
        alert("User has been determined");
        isPoolEnd=true;
      }); 
      while(!isPoolEnd) {
        alert("wait a second");
        this.delay(5000);
      }
      this.ActiveUser=true;
    }
    return UserByLogin;   
  }

  autorize(val:any) {
    var result = this.http.post(this.APIUrl+"Autorization", val).subscribe(res=>{
      this.http.get(this.APIUrl+"Autorization").subscribe(result => {
        if (result==="null") {
          this.ActiveUser=false;
          alert("Check your login and password");
        } else {
          this.CurrentUser=result;
          this.cookieService.set("CurrentUserLogin", this.CurrentUser["Login"]);
          this.cookieService.set("CurrentUserRole", this.CurrentUser["Role"]);
          this.ActiveUser=true;
          alert("Autorization has been successfulled");
        }
      });
    });
    return result;
  }

  addNewUser(val:any) {
    return this.http.post(this.APIUrl+"User", val);
  }

  signOut() {
    return this.http.delete(this.APIUrl+"Autorization").subscribe(result=>{
      alert(result);
    });
  }

  getAllPost():Observable<any> {
    return this.http.get(this.APIUrl+"Post");
  }

  getUserByLogin(Login:string):any {
    var UserByLogin;
    this.http.get<any>(this.APIUrl+"User/"+Login).subscribe(result => {
      UserByLogin =  {
        Name:result["Name"],
        Login:result["Login"],
        Password:result["Password"],
        Email:result["Email"],
        BirthDate:result["BirthDate"],
        AccountCreatingDate:result["AccountCreatingDate"],
        NumberOfPosts:result["NumberOfPosts"],
        Photo:result["Photo"]
      };
    }); 
    alert("please wait a second, load data");
    return UserByLogin;   
  }

  updateUser(val:any) {
    return this.http.put(this.APIUrl+"User", val).subscribe(res=>{});
  }

  uploadPhoto(val:any) {
    return this.http.post(this.APIUrl+"/user/savefile",val);
  }

  addPostReaction(val:any) {
    return this.http.post(this.APIUrl+"PostReaction", val).subscribe(res=>{});
  }

  deletePostReaction(post:string) {
    return this.http.delete(this.APIUrl+"PostReaction/"+post).subscribe(res=>{});
  }

  getImageSource(image:number):string {
    switch(image) {
      case 1: {
        return this.YoungMan1Source;
      }
      case 2: {
        return this.YoungMan2Source;
      }
      case 3: {
        return this.YoungMan3Source;
      }
      case 4: {
        return this.YoungWoman1Source;
      }
      case 5: {
        return this.YoungWoman2Source;
      }
      case 6: {
        return this.YoungWoman3Source;
      }
      default: {
        return "";
      }
    }
  }

  isFriend(login:string):any {
    return this.http.get(this.APIUrl+"Friend/"+login).subscribe(res=>{});
  }
  
  updateFriendship(val:any) {
    return this.http.put(this.APIUrl+"Friend", val).subscribe(res=>{});
  }

  applyNewPost(val:any) {
    return this.http.post(this.APIUrl+"Post", val).subscribe(res=>{});
  }

  updatePost(val:any) {
    return this.http.put(this.APIUrl+"Post", val);
  }

  getFriends() {
    return this.http.get(this.APIUrl+"Friend");
  }

  getFriendApplications(stringToDetermineTabs:string) {
    return this.http.get(this.APIUrl+"Friend/"+stringToDetermineTabs);
  }

  getUsers() {
    return this.http.get(this.APIUrl+"User");
  }

  deletePost(id:string) {
    return this.http.delete(this.APIUrl+"Post/"+id).subscribe(res=>{alert(res);});
  }
}